import prisma from "@/app/data";
import { NextResponse, NextRequest } from "next/server";

// create a new user if it doesn't exist already

export const POST = async (req: NextRequest) => {
  try {
    const body = await req.json();
    // console.log("here's the request content in api/user/POST", body);
  
    
    const result = await prisma.user.findUnique({
      where: {
        email: body.user.email
      }
    });

      if(result == null){
        console.log("I couldn't find a user with that email so I'll create one")
        try {
          const newUser = await prisma.user.create({
            data: {
              name: body.user.name,
              email: body.user.email,
              tags: {
                create: [
                  {
                    name: "Prisma",
                    description: "Prisma's main goal is to make application developers more productive when working with databases.",
                    image: "",
                    notes: {
                      create: {
                        title: "Introduction to Prisma",
                        content: "Prisma is a powerful database toolkit that simplifies database interactions in applications. Learn how to integrate it for efficient data handling.",
                        author: {
                          connect: { email: body.user.email }
                        }
                        ,
                        images: {
                          create: {
                              image: "data:image/png;base64,",
                              description: "Prisma explanation"
                            }
                          }
                        }
                      }
                    },
                    {
                      name: "Next.js",
                      description: "Next.js is a React framework for building server-side rendered and static web applications.",
                      image: "",
                      notes: {
                        create: {
                          title: "Introduction to Next.js",
                          content: "Learn how to use Next.js to build modern, scalable web applications with React.",
                          author: {
                            connect: { email: body.user.email }
                          }
                          ,
                          images: {
                            create: {
                              image: "data:image/jpeg;base64,",
                              description: "Next.js explanation"
                            }
                          }
                        }
                      }
                    },
                    {
                      name: "React.js",
                      description: "React.js is a JavaScript library for building user interfaces.",
                      image: "",
                      notes: {
                        create: {
                          title: "Introduction to React.js",
                          content: "Explore the fundamentals of React.js and build interactive user interfaces.",
                          author: {
                            connect: { email: body.user.email }
                          }
                          ,
                          images: {
                            create: {
                              image: "data:image/jpeg;base64,",
                              description: "React.js features"
                            }
                          }
                        }
                      }
                    },
                  ],
                },
              },
            include:{
              tags:true
            }
          });
            console.log("just created user: ", newUser);
            return NextResponse.json({ newUser });
          } catch (err) {
            console.error("Error creating user:", err);
            return NextResponse.json({ message: "POST Error", err }, { status: 500 });
          }
          
        }else {
            const answer = "the user already exist: "
  
            console.log(answer, result)
            return NextResponse.json({answer});
        }
    } catch (err) {
      console.error("Error finding the user:", err);
      return NextResponse.json({ message: "Error finding the user", err }, { status: 500 });
    }
  };
  





